import ReactDOM from 'react-dom';
import React from "react";
import store from './redux/redux-store';
import './index.css';
import App from './App';
import {BrowserRouter} from "react-router-dom";



ReactDOM.render(
    <BrowserRouter>
        <Provider
            store = {store}>
            <App/>
        </Provider>
    </BrowserRouter>,
    document.getElementById('root')
);
